export default function Filter(props)
{
    return(
        <div className="filter">
            <div className="filtered-words-div">
                {!props.filters.length && <>Add Filters</>}
                {props.filters.length > 0 &&
                    props.filters.map(
                        (item, index) => 
                        <div key={index}>
                            <div>
                                {item}
                            </div>
                            <div>
                                
                            </div>
                        </div>
                    )
                }
            </div>
            <div>
            <h4 className="clear-button" >Clear</h4>
            </div>
        </div>
    );
}
